INSERT INTO `caption` (`id`, `title_home`, `desc_home`, `title_asclepedia`, `desc_asclepedia`, `title_asclepiogo`, `desc_asclepiogo`, `title_about`, `desc_about`) VALUES
(1, 'Hai, Selamat datang di Asclepio!', '<p><strong>Asclepio </strong>merupakan platform edukasi kedokteran online untuk teman-teman sejawat yang berupa kelas online kedokteran, webinar kedokteran, workshop online dan offline kedokteran, dan bimbingan belajar kedokteran yang berkualitas. Wadah belajar kedokteran ini mempunyai karakter yang akan menemani belajar yaitu PIYO.<strong>&nbsp;</strong></p><p><strong>PIYO </strong>akan menemani Asclepian untuk belajar kedokteran secara&nbsp;<strong>SERU</strong> dan&nbsp;<strong>ASIK</strong> di <strong>Asclepedia</strong> dan <strong>Asclepio GO!</strong> Selain itu, kebutuhan alat belajar seperti alkes, manekin, dan scrub akan disediakan oleh <strong>PIYO </strong>di <strong>Asclepio Tools. </strong>Sudah lebih dari 100.000 teman sejawat yang ikutan kelas di Asclepio. Yuk, join kelasnya!</p>', 'Asclepedia ', '<p><strong>Asclepedia</strong> merupakan produk webinar kedokteran, diskusi interaktif bersama dokter spesialis dan workshop online kedokteran. Dengan tagline “Good Morning Knowledge”, PIYO menyediakan <strong>webinar, workshop online, dan diskusi live</strong> materi skills kedokteran dengan pembicara KEREN dan SUPER ENAK mengajarnya. PIYO berharap Asclepian bisa selalu semangat dalam menimba ilmu seperti bangun di pagi hari. Produk ini mencakup <strong>Asclepedia : Good Morning Knowledge </strong>yang merupakan webinar FREE dan <strong>Asclepedia : Skills Lab </strong>yang merupakan workshop online dan diskusi LIVE.</p>', 'Asclepio GO', '<p><strong>Asclepio GO! </strong>merupakan produk bimbingan belajar online untuk Fakultas Kedokteran. Dengan tagline “Evolving Knowledge”, PIYO menyediakan <strong>bimbingan belajar online</strong> dengan kurikulum seperti Anatomi, Fisiologi, Biokimia, pendekatan penyakit, pendekatan klinis, UKMPPD, persiapan PPDS, dan masih banyak lagi dengan pengajar/tutor yang SUPER ENAK dan SUPER SABAR mengajarnya. PIYO berharap Asclepian bisa selalu bertumbuh dan berkembang dalam menimba ilmu kedokteran. Produk ini mencakup <strong>Asclepio GO Open Class, Expert Class, dan Private Class</strong>. Ayo JOIN kelasnya!</p>', 'Asclepio Edukasi Medika Indonesia', '<p>Halo teman sejawat Asclepian semua, perkenalkan kami Asclepio Edukasi Medika Indonesia mempersembahkan sebuah wadah untuk belajar kedokteran dan platform edukasi kedokteran <strong>Asclepio. </strong>Ingin lebih dekat dengan kami, mari simak perjalanan kami.</p>');
