INSERT INTO `seo` (`id`, `meta_title`, `meta_keyword`, `meta_desc`, `page`) VALUES
(1, 'Hai, Selamat datang di Asclepio!', 'asclepio', 'Asclepio merupakan platform edukasi kedokteran online untuk teman-teman sejawat yang berupa kelas online kedokteran, webinar kedokteran, workshop online dan offline kedokteran, dan bimbingan belajar kedokteran yang berkualitas. Wadah belajar kedokteran ini mempunyai karakter yang akan menemani belajar yaitu PIYO. \r\n\r\nPIYO akan menemani Asclepian untuk belajar kedokteran secara SERU dan ASIK di Asclepedia dan Asclepio GO! Selain itu, kebutuhan alat belajar seperti alkes, manekin, dan scrub akan disediakan oleh PIYO di Asclepio Tools. Sudah lebih dari 100.000 teman sejawat yang ikutan kelas di Asclepio. Yuk, join kelasnya!', 'home'),
(2, 'Asclepedia', 'asclepedia', 'Asclepedia merupakan produk webinar kedokteran, diskusi interaktif bersama dokter spesialis dan workshop online kedokteran. Dengan tagline “Good Morning Knowledge”, PIYO menyediakan webinar, workshop online, dan diskusi live materi skills kedokteran dengan pembicara KEREN dan SUPER ENAK mengajarnya. PIYO berharap Asclepian bisa selalu semangat dalam menimba ilmu seperti bangun di pagi hari. Produk ini mencakup Asclepedia : Good Morning Knowledge yang merupakan webinar FREE dan Asclepedia : Skills Lab yang merupakan workshop online dan diskusi LIVE.', 'asclepedia'),
(3, 'Asclepio GO', 'asclepio, platform kedokteran', 'Asclepio GO! merupakan produk bimbingan belajar online untuk Fakultas Kedokteran. Dengan tagline “Evolving Knowledge”, PIYO menyediakan bimbingan belajar online dengan kurikulum seperti Anatomi, Fisiologi, Biokimia, pendekatan penyakit, pendekatan klinis, UKMPPD, persiapan PPDS, dan masih banyak lagi dengan pengajar/tutor yang SUPER ENAK dan SUPER SABAR mengajarnya. PIYO berharap Asclepian bisa selalu bertumbuh dan berkembang dalam menimba ilmu kedokteran. Produk ini mencakup Asclepio GO Open Class, Expert Class, dan Private Class. Ayo JOIN kelasnya!', 'asclepio_go'),
(4, 'Asclepio Edukasi Medika Indonesia', 'webinar kedokteran', 'Halo teman sejawat Asclepian semua, perkenalkan kami Asclepio Edukasi Medika Indonesia mempersembahkan sebuah wadah untuk belajar kedokteran dan platform edukasi kedokteran Asclepio. Ingin lebih dekat dengan kami, mari simak perjalanan kami.', 'about');
