(80, 1745, 71, '4', 'Dokter pemateri sangat encourage partisipan untuk aktif, pembawaan untuk diskusi dibawa santai dan langsung to the point. Saking serunya terasa terlalu cepat dan sesi materi kurang panjang :D', '2022-04-13 13:35:02'),
(81, 697, 48, '4', 'dr. Niken, SpA (K) sangat baik dalam memberi materi. Hanya saja durasi yang singkat dan media simulasi secara online menyebabkan kurangnya pengalaman memperagakan langsung. Semoga kegiatan seperti ini dapat terus dilaksanakan.', '2022-04-14 09:16:34'),
(82, 697, 50, '5', 'dr. Anisa, SpA (K) sangat baik dalam memberi materi. Semoga kegiatan seperti ini dapat terus dilaksanakan.', '2022-04-14 09:17:00'),
